$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_4bc03ef9c3845dc514752ab561622e82'] = 'Als u een foutmelding krijgt \"[b]U heeft niet de juiste autorisatie voor dit verzoek[/b]\" wanneer u via uw Braintree-account toegang krijgt tot uw API-sleutels:';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_5ebd3093031cf04578abc79618f473ff'] = '[b]Uw account was al geconfigureerd:[/b]';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_d137f37fc8a46818c15c2bccc8d727db'] = '-U kunt uw API-sleutels gebruiken als u ze eerder hebt opgeslagen en betalingen via Braintree blijven accepteren als uw account al correct is geconfigureerd. Geen acties vereist van uw kant.';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f47003b97fae0faa5ba397559d48d202'] = '[b]U wilt uw accountconfiguraties wijzigen, maar u kunt uw API-sleutels niet ophalen:[/b]';
$_MODULE['<{paypal}prestashop>sectionbraintreecredentials_f237d0ecec61e571ff21e296c183f44a'] = '- Als u uw API-sleutels niet ergens aan uw zijde heeft opgeslagen, kunt u uw API-inloggegevens voor uw huidige account niet langer gebruiken omdat we ze niet voor u kunnen verstrekken. Als u uw huidige PrestaShop Braintree-module die API-sleutels vereist, wilt blijven gebruiken, moet u een Braintree Direct-account aanvragen door op de knop \"Aanmelden\" onderaan de Braintree-startpagina te klikken. Nadat u bent goedgekeurd voor het nieuwe account, kunt u inloggen en uw API-sleutels ophalen. Als je problemen hebt met het goedkeuringsproces door Braintree, neem dan contact op met Braintree Support op hun website.';
